import Link from 'next/link';

const divStyle = {
  paddingBottom: 0,
  BorderBottom: '10px solid #14a3bb',
}
const linkStyle = {
  marginRight: 20,
  //verticalAlign: 'top' ,
};
const logoStyle = {
  marginLeft: 17,
  marginRight: 20,
  verticalAlign: 'middle' ,
  width: 100
};
const Header = () => (
  <div style={divStyle}>

    <Link href="/">
      <a> <img style={logoStyle} src="../static/logo.png"/></a>
    </Link>
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="#about">
      <a style={linkStyle}>About</a>
    </Link>
    <Link href="#feature">
      <a style={linkStyle}>Feature</a>
    </Link>
    <Link href="/amazon">
      <a style={linkStyle}>Amazon</a>
    </Link>
  </div>

);

export default Header;
